import { useSelector, useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { useState, useMemo } from "react";
// import {
//   calculateFlightPrice,
//   matchCapacity,
//   matchPriceRange,
// } from "../../utils/flightFilterHelper";
import { setSelectedReturnFlight } from "../../redux/slices/searchSlice";

export default function ReturnFlights() {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const { results } = useSelector((state) => state.search);
  const { priceFilters = ["All"], capacityFilters = ["All"] } = useSelector(
    (state) => state.filters
  );

  // Helper functions — MUST be defined BEFORE useMemo
  // ----------------------
  function matchPriceRange(price, range) {
    switch (range) {
      case "₹ 0 - 1,00,000":
        return price >= 0 && price <= 100000;
      case "₹ 1,00,000 - 2,00,000":
        return price > 100000 && price <= 200000;
      case "₹ 2,00,000 - 3,00,000":
        return price > 200000 && price <= 300000;
      case "₹ 3,00,000+":
        return price > 300000;
      default:
        return true;
    }
  }

  function matchCapacity(capacity, range) {
    switch (range) {
      case "5 Persons":
        return capacity === 5;
      case "6 Persons":
        return capacity === 6;
      case "7 Persons":
        return capacity === 7;
      case "8 Persons":
        return capacity === 8;
      case "9+ Persons":
        return capacity >= 9;
      default:
        return true;
    }
  }

  const flights = results?.returnFlights || [];

  const filteredFlights = useMemo(() => {
    let data = [...flights];

    // Helper to calculate grand total for each flight
    const calculateFlightPrice = (flight) => {
      // Find the Flying Cost head
      const flyingCostHead = flight.priceHeads?.find(
        (heads) => heads.head === "68a2c4d345a4c290c0959fe5"
      );

      const otherHeads =
        flight.priceHeads?.filter(
          (heads) => heads.head !== "68a2c4d345a4c290c0959fe5"
        ) || [];

      // Convert travel time (minutes → hours)
      const travelHours = (Number(flight.travelTime + 30) || 0) / 60;

      // Calculate
      const flyingCostPerHour = Number(flyingCostHead?.amount) || 0;
      const flyingCostTotal = flyingCostPerHour * travelHours;

      const otherCostTotal = otherHeads.reduce(
        (sum, head) => sum + (Number(head.amount) || 0),
        0
      );

      const basePrice = flyingCostTotal + otherCostTotal;
      const taxesAndFees = Math.round(basePrice * 0.12);

      // Final grand total (use same as display)
      const grandTotal = flyingCostTotal;

      return grandTotal;
    };

    // PRICE FILTER
    if (!priceFilters.includes("All")) {
      data = data.filter((flight) => {
        const totalPrice = calculateFlightPrice(flight);
        return priceFilters.some((range) => matchPriceRange(totalPrice, range));
      });
    }

    // Capacity Filter
    if (!capacityFilters.includes("All")) {
      data = data.filter((flight) =>
        capacityFilters.some((range) =>
          matchCapacity(Number(flight.capacity || 0), range)
        )
      );
    }

    return data;
  }, [flights, priceFilters, capacityFilters]);

  const handleSelectReturnFlight = (flight) => {
    dispatch(setSelectedReturnFlight(flight));

    // go to booking page
    navigate("/booking");
  };

  return (
    <section className="flight-list-section py-5">
      <div className="container">
        <h3 className="mb-4 fw-bold text-center">Select Return Flight</h3>

        {filteredFlights.length === 0 && (
          <div className="text-center py-5">
            <h5>No return flights available. Please change your search.</h5>
          </div>
        )}

        <div className="row">
          {filteredFlights.map((flight) => {
            const price = calculateFlightPrice(flight);
            const travelHours = (flight.travelTime + 30) / 60;

            return (
              <div key={flight._id} className="col-md-6 mb-4">
                <div className="flight-card p-3 border rounded shadow-sm d-flex">
                  <img
                    src={flight.images?.[0]?.url}
                    alt={flight.name}
                    style={{
                      width: "140px",
                      height: "100px",
                      objectFit: "cover",
                      borderRadius: "8px",
                      marginRight: "14px",
                    }}
                  />

                  <div style={{ flex: 1 }}>
                    <h5 className="fw-bold mb-1">{flight.name}</h5>

                    <p className="mb-1">
                      <strong>Capacity:</strong> {flight.capacity} |{" "}
                      <strong>Baggage:</strong> {flight.baggage} Kg
                    </p>

                    <p className="mb-1">
                      <strong>Duration:</strong> {travelHours.toFixed(1)} hrs
                    </p>

                    <p className="mb-1">
                      <strong>Distance:</strong> {flight.distance} km
                    </p>

                    <h5 className="fw-bold mt-2">₹{price.toLocaleString()}</h5>

                    <button
                      className="btn btn-primary btn-sm mt-2"
                      onClick={() => handleSelectReturnFlight(flight)}
                    >
                      Select Return Flight
                    </button>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </section>
  );
}
